import React from 'react';
import { motion } from 'framer-motion';
import CoffeeParticles from './CoffeeParticles';
import './Achievements.css';

const Achievements = () => {
  const achievements = [
    {
      icon: 'fas fa-trophy',
      title: 'CompTIA Security+',
      category: 'Cybersecurity',
      description: 'Validates baseline cybersecurity skills and provides a springboard to intermediate-level cybersecurity jobs.',
      date: '2025',
      color: '#FF6B35',
      featured: true
    },
    {
      icon: 'fas fa-certificate',
      title: 'CompTIA Network+',
      category: 'Networking',
      description: 'Validates essential knowledge and skills needed to confidently design, configure, manage and troubleshoot networks.',
      date: '2025',
      color: '#006241'
    },
    {
      icon: 'fas fa-graduation-cap',
      title: 'B.S in Computer Science',
      category: 'Education',
      description: 'Comprehensive understanding of computer science fundamentals, algorithms, and software development principles.',
      date: '2023',
      color: '#0077b5'
    },
    {
      icon: 'fas fa-code',
      title: 'Python Development',
      category: 'Programming',
      description: 'Advanced Python programming skills for automation, web development, and data analysis.',
      date: '2024',
      color: '#FFD43B'
    },
    {
      icon: 'fas fa-network-wired',
      title: 'Network Infrastructure',
      category: 'Infrastructure',
      description: 'Expertise in designing and implementing enterprise-level network solutions with high availability.',
      date: '2024',
      color: '#8B4513'
    },
    {
      icon: 'fas fa-shield-alt',
      title: 'Cybersecurity Projects',
      category: 'Security',
      description: 'Successfully completed multiple cybersecurity projects including Digital Defense and Forensics Practice.',
      date: '2024',
      color: '#dc3545'
    }
  ];

  const stats = [
    { number: '2+', label: 'Years Experience', icon: 'fas fa-briefcase' },
    { number: '6', label: 'Projects Completed', icon: 'fas fa-project-diagram' },
    { number: '2', label: 'Professional Certs', icon: 'fas fa-certificate' },
    { number: '100%', label: 'Client Satisfaction', icon: 'fas fa-heart' }
  ];

  return (
    <section id="achievements" className="achievements">
      <CoffeeParticles count={2} />
      <div className="container">
        <motion.h2 
          className="section-title"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
        >
          Achievements & Recognition 🏆
        </motion.h2>
        <motion.p 
          className="section-subtitle"
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          transition={{ delay: 0.2 }}
          viewport={{ once: true }}
        >
          Professional milestones and accomplishments that showcase my expertise
        </motion.p>

        <motion.div 
          className="stats-grid"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.3 }}
          viewport={{ once: true }}
        >
          {stats.map((stat, index) => (
            <motion.div 
              key={stat.label}
              className="stat-card"
              initial={{ opacity: 0, scale: 0.8 }}
              whileInView={{ opacity: 1, scale: 1 }}
              transition={{ delay: 0.4 + index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ scale: 1.05 }}
            >
              <div className="stat-icon">
                <i className={stat.icon}></i>
              </div>
              <div className="stat-number">{stat.number}</div>
              <div className="stat-label">{stat.label}</div>
            </motion.div>
          ))}
        </motion.div>

        <motion.div 
          className="achievements-grid"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.5 }}
          viewport={{ once: true }}
        >
          {achievements.map((achievement, index) => (
            <motion.div 
              key={achievement.title}
              className={`achievement-card ${achievement.featured ? 'featured' : ''}`}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.6 + index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -10, scale: 1.02 }}
            >
              <div className="achievement-header">
                <div className="achievement-icon" style={{ background: achievement.color }}>
                  <i className={achievement.icon}></i>
                </div>
                <div className="achievement-meta">
                  <span className="achievement-category">{achievement.category}</span>
                  <span className="achievement-date">{achievement.date}</span>
                </div>
                {achievement.featured && (
                  <div className="featured-badge">
                    <i className="fas fa-star"></i>
                    Featured
                  </div>
                )}
              </div>

              <div className="achievement-content">
                <h3 className="achievement-title">{achievement.title}</h3>
                <p className="achievement-description">{achievement.description}</p>
              </div>

              <div className="achievement-footer">
                <div className="achievement-progress">
                  <div className="progress-bar" style={{ width: '100%', background: achievement.color }}></div>
                </div>
                <span className="achievement-status">Completed</span>
              </div>
            </motion.div>
          ))}
        </motion.div>

        <motion.div 
          className="achievements-footer"
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          transition={{ delay: 0.8 }}
          viewport={{ once: true }}
        >
          <div className="footer-content">
            <h3>Ready for New Challenges</h3>
            <p>I'm always looking for opportunities to grow and contribute to exciting projects. Let's discuss how we can work together!</p>
            <motion.button 
              className="btn btn-primary"
              onClick={() => document.getElementById('contact').scrollIntoView({ behavior: 'smooth' })}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              <i className="fas fa-paper-plane"></i>
              <span>Get In Touch</span>
            </motion.button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Achievements;
